PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "stamps" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar NOT NULL, "issue_date" varchar DEFAULT '(none)', "description" text, "image_path" varchar DEFAULT '(none)', "remark1" varchar DEFAULT '(none)', "remark2" varchar DEFAULT '(none)', "remark3" varchar DEFAULT '(none)', "area" varchar NOT NULL, "group1" varchar DEFAULT '(none)', "group2" varchar DEFAULT '(none)', "group3" varchar DEFAULT '(none)', "price" varchar DEFAULT '(none)', "status" varchar NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "leaf_id" integer DEFAULT 0);
COMMIT;
